import TableForm from '../TableForm/TableForm'
import Navigation from '../Navigation/Navigation'
import Footer from '../Footer/Footer'

const TableSubpage = () => {

  return (
    <>
      <Navigation />
      <TableForm />
      <Footer />
    </>
  )
}

export default TableSubpage;
